import React from 'react';
import './DiagnosticsInfoDisplay.css';

function DiagnosticsInfoDisplay() {
    return (
        <div className="diagnosticsInfoDisplay-container">
            <h1>Why book with us?</h1>
            <div className="diagnosticsInfoDisplay-content">
                <div className="diagnosticsInfoDisplay-subcontent">
                <i class="fas fa-briefcase-medical"/><p>Home sample collection for FREE<br/>
                A certified professional will collect your sample from your preferred location</p>
                </div>
                <div className="diagnosticsInfoDisplay-subcontent">

                </div>
            </div>
        </div>
    )
}

export default DiagnosticsInfoDisplay;
